const Items = ({ items, setItems }) => {
  const deleteItem = (item) => {
    setItems(items.filter((filtitem) => filtitem.name !== item.name));
  };

  return items.map((item) => (
    <h3>
      {item.name} <button onClick={deleteItem}>Delete</button>
    </h3>
  ));
};
export default Items;
